import json, requests

with open('config.json') as config:
    config = json.load(config)

    token = config.get('token')


headers = {'authorization': token, 'x-super-properties': ''}
request = requests.get('https://discord.com/api/v9/auth/sessions', headers=headers)

response = json.loads(request.text)
for session in response['user_sessions']:

    id_hash = session['id_hash']
    approx_last_used_time = session['approx_last_used_time']
    os = session['client_info']['os']
    platform = session['client_info']['platform']
    location = session['client_info']['location']

    print(f'''
Hash: {id_hash}
Last Use: {approx_last_used_time}
OS: {os}
Platform: {platform}
Location: {location}''')